import React from 'react';

import CardData from '../aboutus/content_about/example'
import RegularCustomer from '../aboutus/content_about/regularCustomer'
import HeaderSignIn from './header_transaction/header_transaction'
import Footer from '../../parts/footer/footer'
import SimpleMap from './ex';
import TransactionContent from './transaction_content/transaction_content'
class Transaction extends React.Component{
  render(){
    return(
      <div>
      <HeaderSignIn/>
      <TransactionContent/>
      <CardData data={RegularCustomer}/>
      <SimpleMap/>
      <Footer/>
      </div>
    )
  }
}
export default Transaction
